package com.jsp.footmap.model;import java.util.Date;/** * 地图类 */public class UserMap {    private int mid;    private int uid;    private Date currentTime;    private String currentPlace;    public int getMid() {        return mid;    }    public void setMid(int mid) {        this.mid = mid;    }    public int getUid() {        return uid;    }    public void setUid(int uid) {        this.uid = uid;    }    public Date getCurrentTime() {        return currentTime;    }    public void setCurrentTime(Date currentTime) {        this.currentTime = currentTime;    }    public String getCurrentPlace() {        return currentPlace;    }    public void setCurrentPlace(String currentPlace) {        this.currentPlace = currentPlace;    }}